import React from "react";
import {Link} from 'react-router-dom';
import M from 'materialize-css';

const NavBar = () => {

	document.addEventListener('DOMContentLoaded', function() {
	    var elems = document.querySelectorAll('.sidenav');
	    var instances = M.Sidenav.init(elems, {edge:'right'});
  	});

	return (
		<div style={{top:"10px", position:"fixed", width:"100%"}}>
			<nav className="transparentBG" style={{padding:"0% 3%"}}>
				  <a href="#!" className="brand-logo left">
				  	<img className="logoimg responsive-img" src="https://rrsecurityservices.com/images/logo.png"/>
				  	<h4 className="right" style={{paddingLeft:"15px", fontSize:"3vw"}}>Rajawat Security Agency</h4>
				  </a>
			      <a href="#" data-target="mobile-demo" className="sidenav-trigger right"><i className="material-icons">menu</i></a>
			      <ul className="right hide-on-med-and-down">
			        <li><a href="sass.html">Sass</a></li>
			        <li><a href="badges.html">Components</a></li>
			        <li><a href="collapsible.html">Javascript</a></li>
			        <li><a href="mobile.html">Mobile</a></li>
			      </ul>
			</nav>
			<ul className="sidenav" id="mobile-demo">
			    <li><a href="sass.html">Sass</a></li>
			    <li><a href="badges.html">Components</a></li>
			    <li><a href="collapsible.html">Javascript</a></li>
			    <li><a href="mobile.html">Mobile</a></li>
			</ul>
		</div>
	);
};


export default NavBar;
